$_MODULE['<{myparcelbe}prestashop>carriers_3edf9a373bacf7ced1ead96297717193'] = 'The Cutoff Time option allows the Merchant to indicate the latest cut-off time before an order will still be picked, packed and dispatched on the same/first set dropoff day, taking into account the dropoff-delay. Industry standard default time is 17:00. For example, if cutoff time is 17:00, Monday is a delivery day and there\'s no delivery delay; all orders placed Monday before 17:00 will be dropped of at %s on that same Monday in time for the Monday collection and delivery on Tuesday.';
$_MODULE['<{myparcelbe}prestashop>carriers_52aa414b634c4b5189b8283e08e62b59'] = 'Exception schedule';
