$_MODULE['<{myparcelbe}prestashop>carriers_e6777e8091e2b601cac51e6dbe781e37'] = 'This option allows the Merchant to set the number of days into the future for which he wants to show his consumers delivery options. For example; If set to 3 (days) in his checkout, a consumer ordering on Monday will see possible delivery options for Tuesday, Wednesday and Thursday (provided there is no drop-off delay, it\'s before the cut-off time and he goes to %s on Mondays). Min. is 1 and max. is 14.';
$_MODULE['<{myparcelbe}prestashop>carriers_feac3e350784adbdf8733df36431f8f1'] = 'Drop off delay';
$_MODULE['<{myparcelbe}prestashop>carriers_3c754f7941321a69e55b82045b659b19'] = 'This option allows the Merchant to set the number of days it takes him to pick, pack and hand in his parcel at %s when ordered before the cutoff time. By default this is 0 and max. is 14.';
